What is the output of the following code?
class SpecialArithmetic {
       public static void main (string args[]) {
                  int x=17,a,b;
                 a=x++;b=++x;
                 System.out.println(“x=” + x +“a=” +a);
                   System.out.println(“x=” + x + “b=” +b);
                   a=x--;b=--x;
                   System.out.println(“x=” + x + “a=” +a);
                   System.out.println(“x=” + x + “b=” +b);
                    }
}

